import React from "react";
import "./Sidebar.css";

export const SidebarData = [
  {
    icon: UilEstate,
    heading: "Dashboard",
  },
  {
    icon: UilClipboardAlt,
    heading: "Orders",
  },
  {
    icon: UilUsersAlt,
    heading: "Customers",
  },
  {
    icon: UilPackage,
    heading: 'Products'
  },
  {
    icon: UilChart,
    heading: 'Analytics'
  },
];


const Sidebar = () => {
    return(
        <div className="sidebar">
            <div className="Sidebar-Inner">
                <div className="menu">
                   <ul className="Sidebar-List">
                       <a href="home" className="menuItem"> Home</a>
                       <a href="profile" className="menuItem"> Profile</a>
                       <a href="weather" className="menuItem">Weather</a>
                       <a href="" className="menuItem">Create New Article</a>
                   </ul>
                </div>
            </div>
        </div>
    );
}

export default Sidebar;
